				fontWeight: 900,
				fontSize: '5rem',
				lineHeight: '4rem',
			}}
		>
			<div
				style={{
					fontSize: '2rem',
				}}
			>
				TRAVELING AROUND
			</div>
			<div
				style={{
					fontSize: '2rem',
				}}
			>
				THE WORLD
			</div>
			<div
				style={{
					fontSize: '3rem',
				}}
			>
				HAS NEVER BEEN
			</div>
			<div
				style={{
					fontSize: '5rem',
				}}
			>
				SO EASY
			</div>
		</div>
	);
}
